query: |
  Query::from("csv_source")
    .filter(Attribute("id") < 16)
    .sink(Sinks::SinkDescriptor::create("File", {{"inputFormat", "CSV"}, {"filePath", "[GENERATED_IN_TEST]"}, {"append", "false"}}));
logical:
  - name: csv_source
    schema:
      - name: id
        type: UINT64
      - name: id2
        type: UINT64
physical:
  - logical: csv_source
    config:
      type: CSV
      filePath: oneToThirtyOneDoubleColumn.csv
      delimiter: ","
